export default class Testeee extends Component {
  constructor() {
    super()

    this.state = {
      username:null,
      password:null,

    }
  }
  changeHandler = e => {
    this.setState({ [e.target.name]: e.target.value })
  }
dokhol(){
  console.log( this.state)
}
render() {
  const { username, password } = this.state
  return (
    <div>
      <form onSubmit={this.dokhol}>
        <div>
          <input
            type="text"
            name="username"
            value={username}
            onChange={this.changeHandler}
          />
        </div>
        <div>
          <input
            type="text"
            name="password"
            value={password}
            onChange={this.changeHandler}
          />
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  )
}
}
